    body:
      encoding: ASCII-8BIT
      string: '{"id":22,"page":1,"results":[{"author":"John Chard","author_details":{"name":"","username":"John
        Chard","avatar_path":"/utEXl2EDiXBK6f41wCLsvprvMg4.jpg","rating":9.0},"content":"Ah,
        but you have heard of me.\r\n\r\nThe crew of the Black Pearl are cursed by
        something most unimaginable, the only way to lift the curse is to return a
        lost Aztec coin to its treasure chest home. In the way of them achieving their
        goal is the British Governor''s daughter, the son of Bootstrap Turner, oh
        and a former comrade by the name of Captain Jack Sparrow who the crew had
        left to die on an island some time ago.\r\n\r\nIt''s now common knowledge
        that Pirates Of The Caribbean is a film based upon a theme park ride of the
        same name, thoughg that ride is not actually a roller-coaster, it''s fair
        to say that this film most assuredly is. A swashbuckling ripper of an adventure
        yarn cramming in every pirate film staple it can and pouring on layers of
        charm at every turn. Into the broth goes romance, comedy and striking adventure,
        and director Gore Verbinski even manages to give the children watching little
        slices of horror, not enough to keep them up at night, but enough to bring
        on an uneasy grin.\r\n\r\nIt''s unashamedly commercial, produced by that purveyor
        of OTT entertainment values, Jerry Bruckheimer, it was to be expected, but
        few blockbusting movies of the new age can lay claim to being such an out
        and out reason for having fun. This is the reason why Pirates had few peers
        at the time of its release, for it knows its reason for being, it''s not taking
        itself seriously. The audience is not being hoodwinked in any way, they are
        having fun because so is the film and so is, crucially, the impressive cast.
        Johnny Depp as Sparrow is having the time of his life, basing the character
        around the dubious mannerisms of Rolling Stone icon, Keith Richards, it works
        to its highest potential and Depp is simply wonderful in the role. Keira Knightley
        (perfectly cast), Orlando Bloom, Geoffrey Rush, Jack Davenport, Jonathan Pryce
        and Mackenzie Crook all do what was asked, which is essentially say your lines
        right and have a blast with it, it really is that sort of picture.\r\n\r\nThe
        subsequent sequels would forget what made this first offering so enjoyable,
        foregoing the outrageous sense of fun for a dark sheen and character development.
        That is a shame, but at the very least we still have this wonderful picture
        to go back to time and time again, to lift you up when one is down or to keep
        one happy when one is already in that happy place. The Curse Of The Black
        Pearl is a joy from start to finish. 9/10","created_at":"2014-09-25T23:26:22.631Z","id":"5424a49ec3a3681eca002c23","updated_at":"2021-06-23T15:57:28.700Z","url":"https://www.themoviedb.org/review/5424a49ec3a3681eca002c23"}],"total_pages":1,"total_results":1}'
